import React from "react";
import { Link } from "react-router-dom";
import { NavWrapper } from "./NavStyles";

const Nav = () => {
  return (
    <NavWrapper>
      <Link
        to={"/"}
        style={{
          color: "hotpink",
          textDecoration: "none",
          textAlign: "center",
        }}
      >
        {" "}
        Home{" "}
      </Link>

      <Link
        to={"/contact"}
        style={{
          color: "hotpink",
          textDecoration: "none",
          textAlign: "center",
        }}
      >
        {" "}
        Contact{" "}
      </Link>
      <header>
        <p>Nav</p>
      </header>
    </NavWrapper>
  );
};

export default Nav;
